import "./App.css";

const list = [
  {
    title: "React",
    url: "https://reactjs.org/",
    author: "Jordan Walke",
    num_comments: 3,
    points: 4,
    objectID: 0,
  },
  {
    title: "Redux",
    url: "https://redux.js.org/",
    author: "Dan Abramov, Andrew Clark",
    num_comments: 2,
    points: 5,
    objectID: 1,
  },
];

function getTitle(title) {
  return title;
}

const App = () => (
  <div className="App">
    <h1>Hello {getTitle("React")}</h1>
    <SearchBox />
    <hr />
    <List />
  </div>
);

export default App;

const SearchBox = () => {
  return (
    <div>
      <label htmlFor="search">Search:</label>
      <input id="search"></input>
    </div>
  );
};

const List = () =>
  list.map((item) => (
    <div key={item.objectID}>
      <span>
        <a href={item.url}>{item.title}:</a>
      </span>
      <span> {item.author}</span>
    </div>
  ));
